#define QUICK_SORT

int partition(int* p, int start, int end) {
    int x = p[end]; // threshold
    int j, tmp, i = start - 1;
    for (j = start; j < end; j++) {
        if (p[j] <= x) {
            i++;
            tmp = p[i];
            p[i] = p[j];
            p[j] = tmp;
        }
    }
    tmp = p[i + 1];
    p[i + 1] = p[end];
    p[end] = tmp;
    return i + 1;
}

void quick_sort(int* p, int start, int end) {
    if (start < end) {
        int q = partition(p, start, end);
        quick_sort(p, start, q - 1);
        quick_sort(p, q + 1, end);
    }
}


