void sort(int* p, int n) {
#ifdef QUICK_SORT
    // Quick sort
    quick_sort(p, 0, n - 1);
#else
    // Bubble sort
    int i, swapped = 1;
    while (swapped != 0) {
        swapped = 0;
        for (i = 0; i < n - 1; i++) {
            if (p[i] > p[i + 1]) {
                int tmp = p[i];
                p[i] = p[i + 1];
                p[i + 1] = tmp;
                swapped = 1;
            }
        }
        n--;
    }
#endif
}
