const int NUMTESTS = 6;
int main(int argc, char* argv[]) {
#ifdef BENCH
  #ifdef BASELINE
  quick_sort(a1, 0, 1000-1);
  quick_sort(a2, 0, 1000-1);
  quick_sort(a3, 0, 1000-1);
  #else
  sort(a1, 0,1000-1);
  sort(a2, 0,1000-1);
  sort(a3, 0,1000-1);
  #endif
  return 0;
#else

    int *p, *t, n, runOnce;
    int arg = load_arg();
    if (arg < 1 || arg > NUMTESTS) {
        arg = 1;
        runOnce = 0;
    } else {
        runOnce = 1;
    }
    do {
        switch (arg) {
            case 1: p = a1; t = r1; n = 7; break;
            case 2: p = a2; t = r2; n = 6; break;
            case 3: p = a3; t = r3; n = 10; break;
            case 4: p = a4; t = r4; n = 20; break;
            case 5: p = a5; t = r5; n = 200; break;
            case 6: p = a6; t = r6; n = 1000; break;
            default: p = a1; t = r1; n = 7; break;
        }

        sort(p, 0, n-1);

        // Evaluation
        int i;
        if (!((arg > 0) && (arg <= NUMTESTS))) {
            print_string("Expected: ");
            for (i = 0; i < n; i++) {
                print_int(t[i]);
                print_string(", ");
            }
            print_string("\nObtained: ");
            for (i = 0; i < n; i++) {
                print_int(p[i]);
                print_string(", ");
            }
            print_string("\n\nFailed test due to corrupted testbench memory (sort can modify testbench memory as they reside in the same program).\nThe test number being ran was corrupted during bubblesort/quicksort, but this is not memory the sorting function should touch.\nThe expected and obtained arrays are likely incorrect as a side-effect of this incorrect memory access.\n\nPlease check 'sw' instructions and calling convention.\nCorrupted Test Number:  ");
            print_int(arg);
            print_string("\n\n");
            return 3;
        }
        for (i = 0; i < n; i++) {
            if (p[i] != t[i]) {
#ifdef __x86_64__
                printf("Failed\n");
#else
                print_string("Expected: ");
                for (i = 0; i < n; i++) {
                    print_int(t[i]);
                    print_string(", ");
                }
                print_string("\nObtained: ");
                for (i = 0; i < n; i++) {
                    print_int(p[i]);
                    print_string(", ");
                }
                print_string("\n\nFailed test ");
                print_int(arg);
                print_string("\n\n");
#endif
                return -1;
            }
        }
#ifdef __x86_64__
        printf("Passed test %d\n", arg);
#else
        print_string("Passed test ");
        print_int(arg);
        print_string("\n\n");
#endif
        arg ++;
        // End evaluation
    } while (runOnce == 0 && arg <= NUMTESTS);
#ifdef __x86_64__
    if (runOnce == 0) printf("\nPassed all tests\n\n");
#else
    if (runOnce == 0) print_string("Passed all tests\n\n");
    return 0;
#endif
#endif// ifdef BENCH
}
